double T_3(double Time) {
   static const map<double, double> XY_Values = {{0.00000000000000000e+00,0.00000000000000000e+00},{1.00000000000000000e+01,-1.00000000000000006e-01},{1.00000000000000000e+02,-1.11111111111111115e-02}   };
   auto iter = XY_Values.lower_bound(Time);
   if(iter==XY_Values.begin()) return XY_Values.begin()->second;
   if(iter==XY_Values.end()) return XY_Values.rbegin()->second;
   double x1 = iter->first;
   double y1 = iter->second;
   --iter;
   double x0 = iter->first;
   double y0 = iter->second;
   return y0 + (y1-y0)/(x1-x0)*(Time-x0);
}

